Entity.ProfileNotes:
FSA NOTES:

Firm Reference Number: 147150

Date: 22 April 2015

1. ACTION

1.1. For the reasons given in this notice, the Authority proposes to impose on MLI a financial penalty of £13,285,900.

1.2. MLI agreed to settle at an early stage of the Authority’s investigation. MLI therefore qualified for a 30% (Stage 1) discount under the Authority’s executive settlement procedures. Were it not for this discount, the Authority would have imposed a financial penalty of £18,979,876 on MLI.

1.3. The Authority has determined that the metric for Step 2 in DEPP 6.5A.2 for cases involving transaction reporting breaches will increase from £1 to £1.50 per breach. The Authority has determined this is necessary to further improve standards of Transaction Reporting.

2. SUMMARY OF REASONS

2.1. The Authority has decided to take action because MLI has contravened SUP 17.1.4R and SUP 17.4.1 EU by failing to report or to accurately report transactions between November 2007 and November 2014 (the “Relevant Period”).

2.2. During the Relevant Period MLI:
(1) Inaccurately reported 35,034,810 transactions, (all of which should have been reported accurately in accordance with SUP 17.4.1 EU/SUP 17 Annex 1 EU); and
(2) Failed entirely to report 121,387 transactions (all of which should have been reported in accordance with SUP 17.1.4R).
2.3. In particular:
(1) Between November 2007 and February 2009 MLI failed to accurately report 4,184,028 agency transactions by incorrectly reporting both counterparty and client as the central counterparty for the market side of transactions, and the client as both counterparty and client for the client side (Breach 1 );
(2) Between November 2007 and September 2009 MLI failed to accurately report 5,134,826 transactions by inaccurately reporting trade times across three product streams (OTC credit and rate derivatives, listed derivatives and cash equities) (Breach 2);

(3) Between November 2007 and June 2011 MLI failed to accurately report 9,600,000 transactions by incorrectly identifying the counterparty where MLI routed transactions to its Spanish affiliate Merrill Lynch Capital Markets Espana (MLCME) (Breach 3);

(4) Between February 2009 and February 2012 MLI failed to accurately report 284,997 transactions by incorrect use of the Buy/Sell indicator (Breach 4);

(5) Between November 2007 and August 2012 MLI failed to accurately report 1,690,000 transactions by incorrectly identifying the counterparty. MLI incorrectly mapped 81 exchange member identifiers in its client static data system for transactions on Scandinavian Exchanges (Breach 5);
(6) Between April 2012 and December 2012 MLI failed to accurately report 3,993,383 transactions by omitting to report the maturity dates of equity swaps (Breach 6);

(7) Between November 2011 and July 2013 MLI failed to report 121,387 listed derivative trades (Breach 7);

(8) Between November 2007 and November 2013 MLI failed to accurately report 4,656,674 transactions by incorrectly identifying the counterparty. MLI reported transactions in the Brazilian market facing the affiliate Banco Merrill Lynch De Investimentos SA (Bco MLSA), whereas the correct counterparty should have been Bovespa exchange member Merrill Lynch SA Corretora de Titulos e Valores Mobiliarios (ML CTVM) (Breach 8);

(9) Between December 2012 and September 2014 MLI failed to accurately report 1,171,843 transactions by incorrectly reporting the BIC code for transactions on the Warsaw exchange (Breach 9);

(10) Between November 2007 and November 2014 MLI failed to accurately report 624,509 transactions executed on the Russian Exchange by incorrectly identifying the correct counterparty (Breach 10); and

(11) Between November 2007 and November 2014 MLI failed to accurately report 3,694,550 transactions by incorrectly identifying the correct counterparty for transactions executed on the US markets. MLI reported transactions to US exchanges rather than to Merrill Lynch Pierce Fenner & Smith (MLPFS) who was acting as broker (Breach 11).

Date: 4 August 2006

TAKE NOTICE: The Financial Services Authority (“the FSA”) of 25 The North Colonnade, Canary Wharf, London, E14 5HS gives you final notice about a requirement to pay a financial penalty:

1. ACTION

1.1. For the reasons listed below, and pursuant to section 206 of the Financial Services and Markets Act 2000 (“the Act”), the FSA proposes to impose a financial penalty upon you, Merrill Lynch International ("Merrill Lynch") in the sum of £150,000 in respect of a breach of Rule 5.49 of the Securities & Futures Authority ("SFA") and SUP 17.6.2R of the FSA Rules.

2. REASONS FOR THE ACTION

2.1. From September 1996 to December 2001, Merrill Lynch breached SFA Rule 5.49 by failing to accurately report the capacity in which it executed transactions in non-UK European equities when reporting transactions to the SFA. From December 2001 until January 2006, Merrill Lynch breached FSA Rule SUP 17.6.2R by failing to accurately report the capacity in which it executed transactions in non-UK European equities when reporting transactions to the FSA.
